import React from "react";

function Header(props){
    return(
        <>
            <div>
                    <div className="flex justifycontent">
                        <p>Shoping Cart</p>
                        <p onClick={() => p}>Cart
                            <sup>{props.count}</sup>
                        </p>
                    </div>    
            </div>  
        </>
    )
}
export default Header;
